import React, { useState } from "react";
import bk from "../bk.jpeg"; // ajusta seg√∫n tu estructura

const GraduationInvitation = () => {
  const [open, setOpen] = useState(false);

  return (
    <div
      className="min-h-screen flex items-center justify-center p-6"
      style={{
        background: "#f0f0f5",
        fontFamily: `"Century Gothic", "Apple Gothic", Arial, sans-serif`,
      }}
    >
      <div className="relative w-full max-w-md rounded-3xl shadow-xl border border-gray-200 overflow-hidden">
        {/* Encabezado visual: parte de la imagen para dar ‚Äúaire‚Äù */}
        <div className="relative w-full" style={{ aspectRatio: "4 / 3" }}>
          <img
            src={bk}
            alt="fondo"
            className="absolute inset-0 w-full h-full"
            style={{
              objectFit: "cover",
              filter: "brightness(1)",
            }}
          />
          {/* Overlay suave para legibilidad */}
          <div
            className="absolute inset-0"
            style={{
              backgroundColor: "rgba(255,255,255,0.55)",
              backdropFilter: "blur(1px)",
            }}
          />
        </div>

        {/* Contenido principal */}
        <div className="p-6 sm:p-8 text-center relative">
          <p
            className="uppercase tracking-widest mb-2"
            style={{
              fontSize: "clamp(0.65rem, 0.8vw, 0.9rem)",
              letterSpacing: "2px",
            }}
          >
            Acomp√°√±ame en esta celebraci√≥n
          </p>

          <h1
            className="mb-1"
            style={{
              fontSize: "clamp(1.75rem, 3vw, 2.75rem)",
              lineHeight: 1.05,
              fontWeight: 700,
            }}
          >
            Obtenci√≥n de Grado <br />{" "}
            <span style={{ fontSize: "0.75em" }}>(o no) üòÖ</span>
          </h1>

          <h2
            className="mt-2 mb-4"
            style={{
              fontSize: "clamp(1.25rem, 2vw, 1.75rem)",
              fontWeight: 700,
              letterSpacing: "0.5px",
            }}
          >
            Doctorado <br />
            Ciencias en Alimentos
          </h2>

          <div
            className="mx-auto mb-6"
            style={{
              fontSize: "clamp(0.9rem, 1.2vw, 1rem)",
              lineHeight: 1.3,
              color: "#2d2d2d",
              maxWidth: "85%",
            }}
          >
            <p className="mb-1">
              <strong style={{ fontWeight: 600 }}>Fecha:</strong> 19 de Agosto de
              2025
            </p>
            <p className="mb-1">
              <strong style={{ fontWeight: 600 }}>Hora:</strong> 1:00 pm
            </p>
            <p className="mb-1">
              <strong style={{ fontWeight: 600 }}>Lugar:</strong> Higgs #36 Col. El
              para√≠so
            </p>
          </div>

          <p
            className="mb-8"
            style={{
              fontSize: "clamp(0.9rem, 1.1vw, 1rem)",
              lineHeight: 1.2,
            }}
          >
            Tu presencia es importante para m√≠ <span>üòä</span>
          </p>

          <div className="flex flex-col sm:flex-row sm:justify-center gap-3">
            <button
              onClick={() => setOpen(true)}
              className="px-5 py-2 rounded-full bg-black text-white text-sm font-medium hover:opacity-90 transition"
              style={{
                fontFamily: `"Century Gothic", "Apple Gothic", Arial, sans-serif`,
              }}
            >
              üìç Ver ubicaci√≥n
            </button>
            <a
              href="https://wa.me/5213113001707?text=%C2%A1S%C3%AD%20asistir%C3%A9%20a%20la%20graduaci%C3%B3n%20de%20la%20Dra.%20Karla%20Ayon!"
              target="_blank"
              rel="noopener noreferrer"
              className="px-5 py-2 rounded-full bg-green-600 text-white text-sm font-medium hover:opacity-90 transition"
              style={{
                fontFamily: `"Century Gothic", "Apple Gothic", Arial, sans-serif`,
              }}
            >
              ‚úÖ Confirmar asistencia
            </a>
          </div>
        </div>
      </div>

      {/* Modal de ubicaci√≥n */}
      {open && (
        <div className="fixed inset-0 bg-black bg-opacity-50 z-50 flex items-center justify-center p-4">
          <div
            className="bg-white rounded-2xl shadow-2xl p-6 max-w-sm w-full text-center relative"
            style={{
              fontFamily: `"Century Gothic", "Apple Gothic", Arial, sans-serif`,
            }}
          >
            <h2 className="text-xl font-semibold mb-3">Ubicaci√≥n del Evento</h2>
            <p className="text-gray-700 mb-4">Higgs #36 Col. El para√≠so</p>
            <iframe
              className="w-full h-48 rounded-lg mb-4"
              src="https://www.google.com/maps?q=Higgs%20%2336%20Col.%20El%20para%C3%ADso&output=embed"
              allowFullScreen
              loading="lazy"
              title="mapa"
            />
            <button
              onClick={() => setOpen(false)}
              className="mt-2 px-5 py-2 bg-black text-white rounded-full hover:opacity-90 transition"
            >
              Cerrar
            </button>
          </div>
        </div>
      )}
    </div>
  );
};

export default GraduationInvitation;
